import React from 'react';
import { Footer } from '../../../../component/major/Footer';
import { Navbar } from '../../../../component/major/Navbar';

export const Learning = () => {
    return (
        <>
            <div>
                <Navbar/>
                <div></div>
                    <p className='poppins-600 text-25 bg-gradient-purple-to-pink text-white px-16 py-16 mt-16 rounded-2xl text-left'>Internet of Things</p>
                <Footer/>
            </div>
        </>
    )
};
